package com.apms.cache.vo;

import java.io.Serializable;

public class AirCraftVo implements Serializable{
	
	private static final long serialVersionUID = -2914958348660621318L;

	private String id;
	
	private String acnum;
	
	private String acmodelId;
	private String acmodel;
	
	private String airlineId;
	private String airline; //航空公司
	
	private String baseOrgId;
	private String baseOrg; //执管基地
	
	private String frameType;//宽/窄休机

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getAcnum() {
		return acnum;
	}

	public void setAcnum(String acnum) {
		this.acnum = acnum;
	}

	public String getAcmodel() {
		return acmodel;
	}

	public void setAcmodel(String acmodel) {
		this.acmodel = acmodel;
	}

	public String getAirline() {
		return airline;
	}

	public void setAirline(String airline) {
		this.airline = airline;
	}

	public String getBaseOrg() {
		return baseOrg;
	}

	public void setBaseOrg(String baseOrg) {
		this.baseOrg = baseOrg;
	}

	public String getFrameType() {
		return frameType;
	}

	public void setFrameType(String frameType) {
		this.frameType = frameType;
	}

	public String getAcmodelId() {
		return acmodelId;
	}

	public void setAcmodelId(String acmodelId) {
		this.acmodelId = acmodelId;
	}

	public String getAirlineId() {
		return airlineId;
	}

	public void setAirlineId(String airlineId) {
		this.airlineId = airlineId;
	}

	public String getBaseOrgId() {
		return baseOrgId;
	}

	public void setBaseOrgId(String baseOrgId) {
		this.baseOrgId = baseOrgId;
	}

}
